        }
    }

    render() {
        return (
            <div className="menuStyle">
                <Link href='/'>
                    <a style={linkStyle}>Home</a>
                </Link>
                <Link href='/list'>
                    <a style={linkStyle}>List</a>
                </Link>

                <div style={{ right: "0px", border: "1px solid red", width: "200px", position: "absolute" }}>
                    <Search />
                </div>
            </div>
        )
    }
}
